			if (hangarCross.clickable) {
				btnSFX.play();
				build.hand.visible = false;
				hangarCross.visible = false;

				hospitalSilueth.visible = false;
				buttonBuildFacility.clickable = true;
				if (buildCount == 0) {
					hospitalCross.visible = true;
				}
				if (build.button.currentFrame <= 1) {
					build.button.gotoAndPlay(1);
				}
			}
		});
		hospitalCross.addEventListener('click', function () {
			if (hospitalCross.clickable) {
				btnSFX.play();
				build.hand.visible = false;
				hospitalCross.visible = false;
				hospitalSilueth.visible = true;
				hangarSilueth.visible = false;
				buttonBuildFacility.clickable = true;
				if (buildCount == 0) {
					hangarCross.visible = true;
				}
				if (build.button.currentFrame <= 1) {
					build.button.gotoAndPlay(1);
				}
			}
		});
		buttonBuildFacility.addEventListener('click', buildClick);
		function buildClick() {
			if (buttonBuildFacility.clickable) {
				btnSFX.play();
				//build facility
				build.button.gotoAndPlay(15);
				buttonBuildFacility.play();
				buttonBuildFacility.hand.visible = false;
				buttonBuildFacility.clickable = false;
				hangarCross.clickable = false;
				hospitalCross.clickable = false;
				upgradeSFX.play();
				if (hangarSilueth.visible) {
					if (buildCount <= 0) {
						main.build.gotoAndPlay(1);
						buildCount++;
					} else {
						main.build.gotoAndPlay(77);
						buildCount++;
					}
				} else if (hospitalSilueth.visible) {
					if (buildCount <= 0) {
						main.build.gotoAndPlay(55);
						buildCount++;
					} else {
						main.build.gotoAndPlay(32);
						buildCount++;
					}
				}
			}
		}
		window.addEventListener('checkBuildCount', checkBuildCount);
		function checkBuildCount() {
			if (buildCount == 1) {
				hangarCross.clickable = true;
				hospitalCross.clickable = true;
			}
			if (buildCount >= 2) {
				//return to main menu
				tasksCount++;
				checkTasks();
				ui.gotoAndPlay(15);
				staff_btn.gotoAndStop(1);
				training_btn.gotoAndStop(1);
				build_btn.gotoAndStop(0);
				staff_btn.clickable = true;
				training_btn.clickable = true;
				createjs.Tween.get(main.build).to({
					alpha: 0,
					visible: false
				}, 375, createjs.Ease.cubicIn);
			}
		}
		buttonHireStaff.addEventListener('click', hireClick);

			if (buttonHireStaff.clickable) {
				btnSFX.play();
				buttonHireStaff.clickable = false;
				buttonHireStaff.play();
				ui.gotoAndPlay(45);
				ui.menu.visible = false;
				staff.play();
				//play staff animation
			}
		}
		function checkTasks() {
			if (tasksCount == 1) {
				buttonHireStaff.clickable = true;
				ui.menu.hand.visible = true;
			}
			if (tasksCount == 2) {
				ui.menu.visible = true;
				ui.menu.hand.visible = false;
			}
			if (tasksCount >= 3) {
				main.gotoAndPlay(79);
			}
		}
		buttonUpgrade.addEventListener('click', upgradeTraining);
		function upgradeTraining() {
			if (buttonUpgrade.clickable) {
				btnSFX.play();
				ui.training.gotoAndStop(ui.training.currentFrame + 1);
				coinSFX.play();
				buttonUpgrade.play();
				upgradeCount++;
				training.play();
